Vue.component("module",{props:["JsonData"],template:'\n            <div>\n                <h3></h3>\n                <div>\n                    <div class="row">\n                        <div class="col" v-for="header in JsonData.headers" v-html="header"></div>                    \n                    </div>\n                    <div class="row" v-for="module in JsonData.Modules">\n                        <div class="col" v-html="module.cat"></div>\n                        <div class="col">\n                            <div v-for="subCat in module.subCat" v-html="subCat.subCatTxt"></div>\n                        </div>\n                        <div class="col">\n                            <div>\n                                <input type="text" v-for="subCat in module.subCat" \n                                disabled :value="subCat.subCatValue"/>\n                            </div>\n                        </div>\n                        <div class="col">\n                            <div>\n                                <input type="checkbox"  v-for="subCat in module.subCat" :checked="subCat.isChecked" :disabled="!subCat.isCheckable" @click="handleSelect(subCat.checkId)"/>\n                            </div>\n                        </div>\n                    </div>\n                </div>\n\n                <div class="survey-begin txt-center">\n                    <div class="btn-item frw" @click="handleForward" v-html="JsonData.frdBtnTxt"></div>\n                </div>\n            </div>\n    ',methods:{handleSelect:function(id){document.getElementById(id).click()},handleForward:function(){document.getElementById("forwardbutton").click()}}});